(418, 1, '2021-04-14 06:59:11', '2021-04-14 06:59:11', '<!-- wp:paragraph -->\n<p>A&nbsp;<strong>case study</strong>&nbsp;is a detailed&nbsp;<strong>study</strong>&nbsp;of a specific subject, such as a person, group, place, event, organization, or phenomenon.&nbsp;<strong>Case studies</strong>&nbsp;are commonly used in social, educational, clinical, and business research</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Case Study Design</strong>. Definition and Purpose. A&nbsp;<strong>case study</strong>&nbsp;is an in-depth&nbsp;<strong>study</strong>&nbsp;of a particular research problem rather than a sweeping statistical survey or comprehensive comparative inquiry. It is often used to narrow down a very broad field of research into one or a few easily researchable examples.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":460,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/nwp/wp-content/uploads/2021/04/case-study-img2-1.jpg\" alt=\"\" class=\"wp-image-460\"/></figure>\n<!-- /wp:image -->', 'Details About Case Study', '', 'publish', 'open', 'closed', '', 'detail-case-study', '', '', '2021-04-15 13:31:02', '2021-04-15 13:31:02', '', 0, 'http://localhost/nwp/?post_type=case_study&#038;p=418', 0, 'case_study', '', 0),
(419, 1, '2021-04-14 06:52:14', '2021-04-14 06:52:14', '', 'case-study-img1-1', '', 'inherit', 'open', 'closed', '', 'case-study-img1-1', '', '', '2021-04-14 06:52:14', '2021-04-14 06:52:14', '', 418, 'http://localhost/nwp/wp-content/uploads/2021/04/case-study-img1-1.jpg', 0, 'attachment', 'image/jpeg', 0),
(420, 1, '2021-04-14 06:57:09', '2021-04-14 06:57:09', '', 'case-study-img2', '', 'inherit', 'open', 'closed', '', 'case-study-img2', '', '', '2021-04-14 06:57:09', '2021-04-14 06:57:09', '', 418, 'http://localhost/nwp/wp-content/uploads/2021/04/case-study-img2.jpg', 0, 'attachment', 'image/jpeg', 0),
(421, 1, '2021-04-14 06:59:11', '2021-04-14 06:59:11', '<!-- wp:image {\"id\":419,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/nwp/wp-content/uploads/2021/04/case-study-img1-1-1024x376.jpg\" alt=\"\" class=\"wp-image-419\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Case studies are in-depth investigations of a single person, group, event or community. Typically, data are gathered from a variety of sources and by using several different methods (e.g. observations &amp; interviews). … In psychology, case studies are often confined to the study of a particular individual.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The most significant benefit of case studies is that they enable a holistic review. Unlike standalone research techniques which give more of a snapshot, eg surveys, a case study offers the opportunity for a researcher to use a range of tools on one subject.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":420,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/nwp/wp-content/uploads/2021/04/case-study-img2.jpg\" alt=\"\" class=\"wp-image-420\"/></figure>\n<!-- /wp:image -->', 'Details Case Study', '', 'inherit', 'closed', 'closed', '', '418-revision-v1', '', '', '2021-04-14 06:59:11', '2021-04-14 06:59:11', '', 418, 'http://localhost/nwp/?p=421', 0, 'revision', '', 0),
