(436, 1, '2021-04-15 12:18:16', '2021-04-15 12:18:16', '<!-- wp:paragraph -->\n<p>T<strong>echnology</strong> is the skills, methods, and processes used to achieve goals. People can use <strong>technology</strong> to: Produce goods or services. Carry out goals, such as scientific investigation or sending a spaceship to the moon. Solve problems, such as disease or famine.</p>\n<!-- /wp:paragraph -->', 'Details About Case Study', 'Read More', 'inherit', 'closed', 'closed', '', '302-revision-v1', '', '', '2021-04-15 12:18:16', '2021-04-15 12:18:16', '', 302, 'http://localhost/nwp/?p=436', 0, 'revision', '', 0),
