(444, 1, '2021-04-15 12:24:40', '2021-04-15 12:24:40', '<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/nwp/wp-content/uploads/2021/04/case-study-img1-1-1024x376.jpg\" alt=\"This image has an empty alt attribute; its file name is case-study-img1-1-1024x376.jpg\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Case studies are in-depth investigations of a single person, group, event or community. Typically, data are gathered from a variety of sources and by using several different methods (e.g. observations &amp; interviews). … In psychology, case studies are often confined to the study of a particular individual</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The most significant benefit of case studies is that they enable a holistic review. Unlike standalone research techniques which give more of a snapshot, eg surveys, a case study offers the opportunity for a researcher to use a range of tools on one subject.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":443,\"width\":335,\"height\":181,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://localhost/nwp/wp-content/uploads/2021/04/case-study-img2-300x162-1.jpg\" alt=\"\" class=\"wp-image-443\" width=\"335\" height=\"181\"/></figure>\n<!-- /wp:image -->', 'Details About Case Study', 'Read More', 'inherit', 'closed', 'closed', '', '302-revision-v1', '', '', '2021-04-15 12:24:40', '2021-04-15 12:24:40', '', 302, 'http://localhost/nwp/?p=444', 0, 'revision', '', 0),
(446, 1, '2021-04-15 12:26:10', '2021-04-15 12:26:10', '<!-- wp:paragraph -->\n<p>In general, when technology attempts to solve problems of matter, energy, space, or time, it is successful. When it attempts to solve human problems of the mind, <strong>communication</strong>, ability, etc</p>\n<!-- /wp:paragraph -->', 'Technology', '', 'inherit', 'closed', 'closed', '', '418-revision-v1', '', '', '2021-04-15 12:26:10', '2021-04-15 12:26:10', '', 418, 'http://localhost/nwp/?p=446', 0, 'revision', '', 0),
(447, 1, '2021-04-15 12:26:49', '2021-04-15 12:26:49', '<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/nwp/wp-content/uploads/2021/04/case-study-img1-1-1024x376.jpg\" alt=\"This image has an empty alt attribute; its file name is case-study-img1-1-1024x376.jpg\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Case studies are in-depth investigations of a single person, group, event or community. Typically, data are gathered from a variety of sources and by using several different methods (e.g. observations &amp; interviews). … In psychology, case studies are often confined to the study of a particular individual</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The most significant benefit of case studies is that they enable a holistic review. Unlike standalone research techniques which give more of a snapshot, eg surveys, a case study offers the opportunity for a researcher to use a range of tools on one subject.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":443,\"width\":335,\"height\":181,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://localhost/nwp/wp-content/uploads/2021/04/case-study-img2-300x162-1.jpg\" alt=\"\" class=\"wp-image-443\" width=\"335\" height=\"181\"/></figure>\n<!-- /wp:image -->', 'Details About Case Study', '', 'inherit', 'closed', 'closed', '', '302-revision-v1', '', '', '2021-04-15 12:26:49', '2021-04-15 12:26:49', '', 302, 'http://localhost/nwp/?p=447', 0, 'revision', '', 0),
(448, 1, '2021-04-15 12:27:07', '2021-04-15 12:27:07', '<!-- wp:paragraph -->\n<p>In general, when technology attempts to solve problems of matter, energy, space, or time, it is successful. When it attempts to solve human problems of the mind,&nbsp;<strong>communication</strong>, ability, etc</p>\n<!-- /wp:paragraph -->', 'Technology', '', 'inherit', 'closed', 'closed', '', '418-revision-v1', '', '', '2021-04-15 12:27:07', '2021-04-15 12:27:07', '', 418, 'http://localhost/nwp/?p=448', 0, 'revision', '', 0),
