(461, 1, '2021-04-15 12:42:20', '2021-04-15 12:42:20', '<!-- wp:image {\"id\":455,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/nwp/wp-content/uploads/2021/04/case-study-img1-1-1024x376-1.jpg\" alt=\"\" class=\"wp-image-455\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>A <strong>case study</strong> is a detailed <strong>study</strong> of a specific subject, such as a person, group, place, event, organization, or phenomenon. <strong>Case studies</strong> are commonly used in social, educational, clinical, and business research</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Case Study Design</strong>. Definition and Purpose. A <strong>case study</strong> is an in-depth <strong>study</strong> of a particular research problem rather than a sweeping statistical survey or comprehensive comparative inquiry. It is often used to narrow down a very broad field of research into one or a few easily researchable examples.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":460,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/nwp/wp-content/uploads/2021/04/case-study-img2-1.jpg\" alt=\"\" class=\"wp-image-460\"/></figure>\n<!-- /wp:image -->', 'Details About Case Study', 'Read More', 'inherit', 'closed', 'closed', '', '418-revision-v1', '', '', '2021-04-15 12:42:20', '2021-04-15 12:42:20', '', 418, 'http://localhost/nwp/?p=461', 0, 'revision', '', 0),
