(476, 1, '2021-04-15 14:51:25', '2021-04-15 14:51:25', '<!-- wp:image {\"id\":489,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/nwp/wp-content/uploads/2021/04/case-study-img1-3-1024x376.jpg\" alt=\"\" class=\"wp-image-489\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.contentmx.com/cyber-security-content/\"><br></a><strong>Cyber</strong> Security is a specialized field in Information Technology (IT) which is regarded as a substream in Computer Science. <strong>Cyber</strong> Security courses aims to equip students with the knowledge and skills required to defend the computer operating systems, networks and data from <strong>cyber</strong>-attacks.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":491,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/nwp/wp-content/uploads/2021/04/case-study-img2-3.jpg\" alt=\"\" class=\"wp-image-491\"/></figure>\n<!-- /wp:image -->', 'Cyber Case Study', 'Read More', 'publish', 'open', 'closed', '', 'cyber', '', '', '2021-04-16 06:48:48', '2021-04-16 06:48:48', '', 0, 'http://localhost/nwp/?post_type=casestudy&#038;p=476', 0, 'casestudy', '', 0),
