(500, 1, '2021-04-15 15:37:57', '2021-04-15 15:37:57', '<!-- wp:image {\"id\":493,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/nwp/wp-content/uploads/2021/04/case-study-img1-4-1024x376.jpg\" alt=\"\" class=\"wp-image-493\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.google.com/search?q=education+content&amp;client=ubuntu&amp;channel=fs&amp;tbm=isch&amp;source=iu&amp;ictx=1&amp;fir=JWDIxqd22peRRM%252CQ1yUoKM5WwguzM%252C_&amp;vet=1&amp;usg=AI4_-kSKL25F6f-6LpHORoI3vCjoZ7uSLQ&amp;sa=X&amp;ved=2ahUKEwjj9pbUyYDwAhX8xDgGHc7bC1AQ9QF6BAgNEAE#imgrc=JWDIxqd22peRRM\"></a><strong>Educational content</strong> is often created to stand on its own, but it can certainly be entertaining, informational, inspiring, and engaging. <strong>Content</strong> that educates is not limited to manuals and textbooks; other examples include tutorials, how-to guides, recipes, product reviews, and step-by-step videos.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ideally, <strong>education</strong> enhances both cognitive and noncognitive capabilities. Cognitive skills <strong>include</strong> knowledge, reasoning, problem solving, and communication abilities. Noncognitive skills <strong>include</strong> discipline, focus, perseverance, punctuality, friendliness, and much more.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":496,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/nwp/wp-content/uploads/2021/04/case-study-img2-4.jpg\" alt=\"\" class=\"wp-image-496\"/></figure>\n<!-- /wp:image -->', 'Education case study', 'Read More', 'inherit', 'closed', 'closed', '', '479-revision-v1', '', '', '2021-04-15 15:37:57', '2021-04-15 15:37:57', '', 479, 'http://localhost/nwp/?p=500', 0, 'revision', '', 0),
