(652, 1, '2021-04-23 12:26:57', '2021-04-23 12:26:57', '<div class=\"control-group\">\r\n       <div class=\"form-group floating-label-form-group controls mb-0 pb-2\">\r\n            <label>Your Name (required)</label>\r\n             [text* your-name id:name class:form-control placeholder \"Your Name\"]\r\n             <p class=\"help-block text-danger\"></p>\r\n       </div>\r\n</div>\r\n\r\n<div class=\"control-group\">\r\n       <div class=\"form-group floating-label-form-group controls mb-0 pb-2\">\r\n            <label>Email Address</label>\r\n             [email* your-email id:email class:form-control placeholder \"Email Address\"]\r\n             <p class=\"help-block text-danger\"></p>\r\n       </div>\r\n</div>\r\n\r\n<div class=\"control-group\">\r\n         <div class=\"form-group floating-label-form-group controls mb-0 pb-2\">\r\n             <label>Message</label>\r\n              [textarea* your-message id:message class:form-control 10x5 placeholder \"Message\"]\r\n              <p class=\"help-block text-danger\"></p>\r\n          </div>\r\n</div>\r\n<br>\r\n\r\n<div class=\"form-group\">\r\n     [submit id:submit class:btn class:btn-block class:btn-theme \"SUBMIT\"]\r\n</div>\n1\n[_site_title] \"[your-subject]\"\n[nwp] <admin@gmail.com>\nadmin@gmail.com\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\nName : [your-name]\r\nEmail :[your-email]\r\nMessage :[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\nReply-To: [your-email]\n\n1\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <admin@gmail.com>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Send Message Us', '', 'publish', 'closed', 'closed', '', 'send-message-us', '', '', '2021-04-23 13:22:55', '2021-04-23 13:22:55', '', 0, 'http://localhost/nwp/?post_type=wpcf7_contact_form&#038;p=652', 0, 'wpcf7_contact_form', '', 0),
